elf**: Take time for self-care and reflection. Understanding your own needs and desires is crucial for a healthy relationship.\\n\\n4. **Astrological Practices**: You might find it beneficial to meditate under the influence of Venus, especially on Fridays, which are ruled by this planet. Wearing colors like pink or green can also enhance Venusian energy.\\n\\nIf there's anything more specific you'd like to explore or if you have additional details to share, feel free to let me know! I'm here to assist you on this cosmic journey.", "confidence_score": 0.85}, {"id": "e36bf91d-879c-4287-8296-6eaf6a7f4b0c", "user_id": "1d5507ea-f559-419e-a5cd-97958148e572", "ai_model": null, "created_at": "2025-09-14T10:19:00.425184+00:00", "sender_type": "user", "tokens_used": null, "context_used": null, "conversation_id": "fe68ff6d-e3ea-4695-b30c-cb0d69955342", "message_content": "hello can you help me about my love life?", "confidence_score": null}, {"id": "ddf1863c-8550-423a-99eb-5e891a717792", "user_id": "1d5507ea-f559-419e-a5cd-97958148e572", "ai_model": "gpt-4o", "created_at": "2025-09-14T10:19:13.357818+00:00", "sender_type": "ai", "tokens_used": 1394, "context_used": {"userProfile": {"id": "1d5507ea-f559-419e-a5cd-97958148e572", "role": "super_admin", "email": "bahuguna.vimal@gmail.com", "phone": null, "address": null, "city_id": null, "metadata": {}, "state_id": null, "timezone": null, "is_active": true, "last_name": "Bahuguna", "tenant_id": "54ecbe98-3b0d-4129-b7f2-97d38f035c22", "avatar_url": null, "birth_date": null, "birth_time": null, "country_id": null, "created_at": "2025-09-12T08:34:47.157818+00:00", "first_name": "Vimlesh", "updated_at": "2025-09-12T08:34:47.157818+00:00", "preferences": {}, "birth_city_id": null, "last_login_at": null, "organization_id": null}, "recentCharts": [{"birth_date": "1963-07-17", "chart_data": {"houses": [180, 210, 240, 270, 300, 330, 0, 30, 60, 90, 120, 150], "system": "vedic", "aspects": [], "planets": [{"name": "Sun", "house": -8, "speed